import React, {useEffect} from 'react';
import { Link, Redirect } from 'react-router-dom';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import { updateStockData } from '../actions/stockdata'


const Landing = ({updateStockData, stockdata: {x, y, loading, company}}) => {

   useEffect(() => {
      if (!loading) {
         updateStockData()
      }
   })

   return (
    <section className="landingPage">

    </section>
   )
}

Landing.PropTypes = {
   updateStockData: PropTypes.func.isRequired,
   stockdata: PropTypes.func.isRequired
}

const mapStateToProps = state => ({
   stockdata: state.stockdata
});

export default connect(mapStateToProps, { updateStockData })(Landing);
